import Vue from 'vue'
import App from './App.vue'
import store from "./store/index";
import { Container, Header,Main,Footer,Aside} from 'element-ui';

Vue.config.productionTip = false
Vue.use(Container,Header,MainFooter,Aside)
Vue.use(Select)

new Vue({
  render: h => h(App),
  store
}).$mount('#app')
